import React, { Component } from "react";
import { Container } from "react-bootstrap";

import ResultService from "../../service/Results.service";

class Results extends React {
  constructor(props) {
    super(props);
    this._service = new ResultService();
    this.state = {};
  }
  render() {
    return (
      <Container>
        <section>
          <h1>Resultados</h1>
        </section>
      </Container>
    );
  }
}

export default Results;
